pagetriage-edits:
The number of times the page has been edited. Parameters:
* $1 - number of edits
{{Identical|Edit}}

pagetriage-categories:
The number of categories in the page. Parameters:
* $1 - number of categories
{{Identical|Category}}

pagetriage-showing:
The heading of a list of types of edits that are currently shown. An adjective that describes edits.

