Article info flyout statistics.

* $1 is a list of stats separated by {{msg-mw|pagetriage-dot-separator}}. For example:<br /> {{int:Pagetriage-bytes|123}}{{int:pagetriage-dot-separator}}{{int:Pagetriage-edits|45}}{{int:pagetriage-dot-separator}}{{int:Pagetriage-categories|6}}

{{Identical|Stats}}

