Label for the collapsed version of the curation bar. Written vertically. See screenshot.
{{Identical|Curation}}

pagetriage-toolbar-learn-more:
Text that links to a page with more information about the curation toolbar.

Note: the right-pointing double ''guillemot'' character (») used in English is actually meant here as an arrow head pointing in the foreward direction. Adapt it to the script direction and to the language if this seems to be an incorrect quotation mark. Possible alternatives are:<br /> ◂ ◃ ◀ ◁ « » ▷ ▶ ▹ ▸.

{{Identical|Learn more}}
